import React from 'react';

const TempUnit = ({ celsiusChecked, handleUnitChange, onCelChecked, onFahChecked }) => {
    console.log(celsiusChecked);
    return (
        <td>
            <table className="ui two very basic column table">
                <tbody>
                    <tr>
                        <td>
                            <input
                                type="radio"
                                checked={celsiusChecked}
                                onChange={handleUnitChange}
                            />
                            <label>'C</label>
                        </td >
                        <td>
                            <input
                                type="radio"
                                checked={!celsiusChecked}
                                onChange={handleUnitChange}
                            />
                            <label>'F</label>
                        </td>
                    </tr>
                </tbody>
            </table >
        </td>
    );
};

export default TempUnit;
